object.property:
The ISDN physical layer state according to I.430

f1(1)		= inactive;
f2(2)		= sensing;
f3(3)		= deactivated;
f4(4)		= awaiting signal;
f5(5)		= identifying input;
f6(6)		= synchronized;
f7(7)		= activated;
f8(8)		= lost framing;
g1(9)		= deactive;
g2(10)	= pending activation;
g3(11)	= active;
g4(12)        = pending deactivation

The state of this command (i.e., biboAdmConfigCmd).

todo(1)		= The command has not started;
running(2)	= The command is executing;
done(3)		= The command successfully
		  completed;
error(4)	= The command failed (see
		   the biboAdmSyslogTable).

Negative Slip conditions detected since startup;
flags that the frequency of receive clock is greater
than frequency of internal system clock

Positive Slip conditions detected since startup;
flags that the frequency of receive clock is less
than frequency of internal system clock

The X21 physical layer state

dn(1)		physical layer is inactive;
up(2)		physical layer is active;

The desired state of the interface.  The
testing(3) state indicates that no operational
packets can be passed.  The dialup(4) state
can be used to initiate a call.

	up(1)		= ready to pass packets; 
	down(2);
	testing(3)	= in some test mode;
	dialup(4)   	= initiate a call on a dialup
                    interface for some reason

The type of interface, distinguished according to
the physical/link protocol(s) immediately `below'
the network layer in the protocol stack.

