The type of mapping. Setting this object to the value
invalid(2) has the effect of invalidating the 
corresponding entry in the ipNetToMediaTable. 
	The entry is then removed from the 
ipNetToMediaTable.

         other(1)	= none of the following;
         delete(2);
         invalid(2)	= an invalidated mapping;
         dynamic(3);
         static(4)

The routing mechanism via which this route was
learned.  Inclusion of values for gateway routing
protocols is not intended to imply that hosts
should support those protocols.

	other(1)	= none of the following;

  local(2         = non-protocol information
                    e.g., manually configured
  		  entries;

  netmgmt(3)      = set via a network
                    management protocol;

  icmp(4)         = obtained via ICMP,
                    e.g., Redirect;   

                    the remaining values are
                    all gateway routing  
                    protocols:
    egp(5);
    ggp(6);

    hello(7);
